import './Chessboard.css';
import { SquareModel } from '../../../../model/SquareModel';
import { PawnModel } from '../../../../model/PawnModel';
import { RookModel } from '../../../../model/RookModel';
import { Piece } from '../pieces/Piece';

export default function Square(props: {squareModel: SquareModel}){
    const squareModel:SquareModel = props.squareModel;
    const piece = squareModel.getPiece();

    let pieceView = undefined;
    if(piece?.getType() == "Pawn"){
        pieceView = <Pawn pawn={new PawnModel(piece.getType(),piece.getColor())}></Pawn>
    }
    else if(piece?.getType() == "Rook"){
        pieceView = <Rook rook={new RookModel(piece.getType(),piece.getColor())}></Rook>
    }

    return (<div className={squareModel.getColor()+"Square"} id={squareModel.getPos()}>
                <Piece />
            </div>);
}
